import { connect } from 'react-redux';
import { TopicWrapper, TopicItem } from '../style.js';
import news from '../../../statics/news.png';

class Topic extends Component {
	render() {
		return (
			<TopicWrapper>
				<TopicItem>
					<img className="topic-pic" src={news}/>
					news
				</TopicItem>
			</TopicWrapper>
		)
	}
}

export default Topic;
